import './App.css';

function App() {
  return (
    <div className="App">
    <table style = {{
	    backgroundColor : 'orange',
		display : 'block',
		color : '#fff',
		paddingLeft : 16
	}}>
	<tbody>
	<tr>
	<td width = "50"><img src = "moviedb.svg"/></td>
    <td width = "8"></td>
	<td><h1>MoviesDB Search</h1></td>
	</tr>
	</tbody>
	</table>
	</div>
  );
}

export default App;
